import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Card';
import CardData from './CardInfo';


//console.log(CardData[1]);

//function nCard(value){
//}

ReactDOM.render(
  <>
      <h1 className="heading_style">List of Top Netflix Shows</h1>
      {CardData.map((value)=>{
        return (
          <Card
            src={value.mySrc}
            link={value.myLink}
            category={value.myCategory}
            title={value.myTitle}
          />

        );
      })} 

  </>,document.getElementById('root')
);
